import React, { Component } from "react";
import { Nav, NavBar } from "react-bootstrap";

class Navigation extends Component {
  render() {
    return (
      <Navbar expand="lg">
        <NavBar.Brand href="/">Mastery Music Academy</NavBar.Brand>
      </Navbar>
    );
  }
}

export default Navigation;
